    <div class=\"container text-center\">

        <div class=\"jumbotron\">
            <h1>
                <small>Log into</small>
                bemanto
            </h1>
        </div>
        {% if error %}

            <div id=\"errorMsg\" class=\"alert alert-danger alert-dismissible fade show container col-sm-6 text-center\" role=\"alert\">
