                <strong>Error! </strong> {{ error.messageKey }}
            </div>

        {% endif %}


        <form action=\"{{ path('login') }}\" method=\"post\" class=\"container col-sm-6\">

            <div class=\"form-group text-left\">
                <label for=\"username\">Email</label>
                <input type=\"text\" name=\"_username\" class=\"form-control\" id=\"username\" value=\"{{ last_username }}\">
            </div>
            <div class=\"form-group text-left\">
                <label for=\"pwd\">Password:</label>
                <input type=\"password\" class=\"form-control\" name=\"_password\" id=\"pwd\">
            </div>

            <button type=\"submit\" class=\"btn btn-primary\">Login</button>
        </form>
        {{ error }}

    </div>
{% endblock %}
